DROP TABLE IF EXISTS `utenti`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `utenti` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nome` varchar(100) NOT NULL,
  `cognome` varchar(100) DEFAULT NULL COMMENT 'NULL solo per SSP',
  `data_nascita` date DEFAULT NULL COMMENT 'NULL solo per SSP',
  `username` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `sesso` char(1) DEFAULT NULL COMMENT 'm|f',
  `cf` varchar(20) DEFAULT NULL COMMENT 'NULL solo per SSP',
  `ruolo` char(32) NOT NULL DEFAULT 'paziente' COMMENT 'paziente | medico | medico_spec | ssp',
  `id_medico` int(11) DEFAULT NULL,
  `provincia` int(11) NOT NULL,
  `comune` int(11) DEFAULT NULL COMMENT 'NULL solo per SSP',
  `paziente_attivo` tinyint(1) DEFAULT 1 COMMENT 'Per indicare account paziente bloccato o meno',
  `medico_attivo` tinyint(1) DEFAULT 0 COMMENT 'Per indicare medico in attività oppure in pensione',
  `specialita` text DEFAULT NULL,
  `laurea` text DEFAULT NULL,
  `inizio_carriera` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`),
  UNIQUE KEY `cf` (`cf`),
  KEY `fk_utente_to_comuni` (`comune`),
  KEY `fk_utenti_to_province` (`provincia`),
  KEY `fk_paziente_to_medico` (`id_medico`),
  CONSTRAINT `fk_paziente_to_medico` FOREIGN KEY (`id_medico`) REFERENCES `utenti` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_utente_to_comuni` FOREIGN KEY (`comune`) REFERENCES `comuni` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `fk_utenti_to_province` FOREIGN KEY (`provincia`) REFERENCES `province` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=341 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

